import React from "react";
import "./Header.css";
import logo from "../assets/Logo WO Branding-02 1.png";
import Button from "@mui/material/Button";
function Header() {
  return (
    <div className="header">
      <div className="logo">
        <img
          src={logo}
          alt="logo"
          style={{ width: "95.872px", height: "92.448px" }}
        />
        <p>Webure</p>
      </div>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
          color: "#5D5D5F",
          fontSize: "21.144px",
        }}
      >
        <p>About Us</p>
        <p>Services</p>
        <p>Career</p>
        <p>Clientele</p>
      </div>
      <Button variant="contain">Contact Us</Button>
    </div>
  );
}

export default Header;
